import React, { Component } from 'react';
/* import TestToBeGiven from './TestToBeGiven'; */
import history from '../history';
import './login.css'

class Login extends Component {

    state={
        tempUserName : "",
        tempUserPassword : "",
        tempUserEmail : "",
        UserName : null,
        UserPassword: null,
        UserEmail : null
    }

    temp = (event) =>{            
            let {
                name,value
            }   = event.target  
            this.setState({
                 [name] : value
                })
        }

    submit = (e) =>{
        e.preventDefault();
        this.setState({
            UserName : this.state.tempUserName,
            UserPassword : this.state.tempUserPassword,
            UserEmail : this.state.tempUserEmail
           }, ()=>{
               console.log("name",this.state.UserName)
               console.log("password",this.state.UserPassword)
               console.log("email",this.state.UserEmail)
           })
    }



  render() {
    return (
         <div className="login-page">
        <div className="form registered ">
            <form className=" login-form" onSubmit={this.submit}>
                <input type="text" value={this.state.tempUserName} onChange={this.temp}  placeholder="user name" name="tempUserName" />
                <input type="password" value={this.state.tempUserPassword} onChange={this.temp} name="tempUserPassword" id="name" placeholder="Password"/>
                <input type="email" value={this.state.tempUserEmail} onChange={this.temp} name="tempUserEmail" id="passwor" placeholder="Email"/>
                <input type="submit" value="SIGN UP" className="btn"/>
                <p className="msg">Already Registered?</p>
            </form> 
        </div>
        </div>

    );
  }
}

export default Login;
